import React from "react";

export default function BookList() {
  return (
    <div>
      <div className="row">
        <div className="col-3">
          <div className="card">
            <img src="" alt="" className="card-img-top" />
            <div className="card-body">
              <p className="card-text"></p>
            </div>
          </div>
        </div>
        <div className="col-3"></div>
        <div className="col-3"></div>
      </div>
    </div>
  );
}
